import React from "react";

function ToDoList(props) {
  return (
    <div>
      {props.todos.map((todo) => (
        <div>
          <h1>{todo}</h1>
          <button className="btn btn-danger" onClick={props.handleDelete}>
            Delete
          </button>
        </div>
      ))}
    </div>
  );
}

export default ToDoList;
